DROP DATABASE IF EXISTS images;

CREATE DATABASE images;

USE images;

CREATE TABLE deal_images (
id int NOT NULL AUTO_INCREMENT,
is_trending boolean NOT NULL default 0,
URL0 varchar(255) NOT NULL,
URL1 varchar(255),
URL2 varchar(255),
URL3 varchar(255),
URL4 varchar(255),
URL5 varchar(255),
URL6 varchar(255),
URL7 varchar(255),
URL8 varchar(255),
URL9 varchar(255), 
PRIMARY KEY (id)
);


